const Moves = (props) => {
    let o = {}


    const test = props.moves.reduce((acc, curr) => {
        acc = {}

        curr.version_group_details.forEach(move => {
            if(acc[move.version_group.name]){
                acc[move.version_group].push(move)
            } else {
                acc[move.version_group] = []
            }
        })

        return null
    })

    return (
        <div>

        </div>
    )
}

export default Moves
